import sys

class Solution:
    def calculate(self, s: str) -> int:
        def helper(s, index):
            stack = []
            current_number = 0
            operation = '+'
            while index < len(s):
                char = s[index]
                if char.isdigit():
                    current_number = current_number * 10 + int(char)
                elif char in '+-*/':
                    if operation == '+':
                        stack.append(current_number)
                    elif operation == '-':
                        stack.append(-current_number)
                    elif operation == '*':
                        stack[-1] = stack[-1] * current_number
                    elif operation == '/':
                        stack[-1] = int(stack[-1] / current_number)
                    current_number = 0
                    operation = char
                elif char == '(':  # Handle parentheses
                    current_number, index = helper(s, index + 1)
                elif char == ')':
                    break
                index += 1
            if operation == '+':
                stack.append(current_number)
            elif operation == '-':
                stack.append(-current_number)
            elif operation == '*':
                stack[-1] = stack[-1] * current_number
            elif operation == '/':
                stack[-1] = int(stack[-1] / current_number)
            return sum(stack), index

        s = s.replace(' ', '')
        result, _ = helper(s, 0)
        return result

if __name__ == '__main__':
    expr = sys.stdin.read().strip()
    result = Solution().calculate(expr)
    print(result)
